import styled from 'styled-components';

const Snavbar = styled.div`
    /* z-index: 111; */
    opacity: 1;
    background-color: #121212;
    .logo {
        font-size: 3rem;
        color: White;
        font-weight: bold;
        letter-spacing: 1rem;
    }
`;

export {Snavbar};
